import React from 'react'
import OneProducts from './OneProducts';
import { books } from '../book';

const AllProducts = () => {
  return (
    <div>
        {books.map((p)=>{
            <OneProducts key={p.id} p={p}></OneProducts>
        })}
      
    </div>
  )
}

export default AllProducts
